/*eslint strict:0, no-console:0 */
'use strict';
import * as lib from './index';
import program from 'commander';
import packageInfo from '../package.json';
const convertToList = function (val, map, filter) {
  let arr = (val || '').toString()
    .replace(/,/gi, ' ')
    .replace(/\s+/gi, ' ').split(' ');
  if (typeof map === 'function') {
    arr = arr.map(map);
  }
  if (typeof filter === 'function') {
    arr = arr.filter(filter);
  }
  return arr;
};
const convertToNumberList = function (val) {
  return convertToList(val, parseFloat, Number.isFinite);
};
const types = {
  'empty': 'BaseStats',
  'basic': 'BasicNumberStats',
  'stats': 'NumberStats',
  'advanced': 'AdvancedNumberStats'
};
let collector;

// handle errors
process.on('uncaughtException', function (e) {
  console.error(e.toString());
});

program
  .version(`${packageInfo.name} version ${packageInfo.version}`, '-v, --version')
  .usage('[options] <values>')
  .option('-c, --collectors [collectors]', 'add collectors', convertToList, [])
  .option('-f, --filters [filters]', 'add filters', convertToList, [])
  .option('-t, --type [type]', 'type of stats [empty,basic,stats,advanced]', 'stats')
  .option('-p, --pipe', 'whether or not to accept piped data from stdin')
  .parse(process.argv);

// setup defaults and validate
program.collectors = program.collectors || [];
program.filters = program.filters || [];
program.type = program.type || '';
program.type = program.type.toLowerCase();
if (!types.hasOwnProperty(program.type)) {
  throw new Error('Invalid type passed');
}
program.type = types[program.type];
collector = new (lib[program.type])();

// validate collectors and filters
['collectors', 'filters'].forEach(function (type) {
  program[type].forEach(function (curr) {
    // allow case-insensitivity on cli
    curr = curr.toLowerCase();
    const keys = Object.keys(lib[type].number);
    const lcaseKeys = Object.keys(lib[type].number)
      .map(function (k) {
        return k.toLowerCase();
      });
    const keyIndex = lcaseKeys.indexOf(curr);
    if (keyIndex === -1) {
      throw new Error(`Invalid ${type} passed`);
    } else if (type === 'collectors') {
      collector.addCollector(new lib[type].number[keys[keyIndex]]());
    } else {
      collector.addFilter(lib[type].number[keys[keyIndex]]);
    }
  });
});

collector.processAll(convertToNumberList(program.args));

const onData = function (data) {
  collector.processAll(convertToNumberList(data.toString()));
};

const onFinish = function () {
  console.log(JSON.stringify(collector.get(true), null, '  '));
  process.exit(0);
};

if (program.pipe) {
  process.stdin.resume();
  process.stdin.setEncoding('utf8');
  process.stdin.on('data', onData);
  process.stdin.on('end', onFinish);
  process.stdin.on('exit', onFinish);
} else {
  onFinish();
}

/**
 * A base Collector class. You can add the following methods when you extend it:
 *   - handleProcess(state, prev, val)
 *   - handleGet(state)
 */
export default class Collector {
  constructor(name, initialValue, requirements = []) {
    this.name = name;
    this.initialValue = initialValue;
    this.requirements = requirements;
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `count`
 */
export default class Count extends Collector {
  constructor() {
    super('count', 0);
  }
  handleProcess(state, prev) {
    return prev + 1;
  }
}

import Collector from '../Collector';

/**
 * A collector that captures a named `count` after a filter is applied
 */
export default class FilteredCount extends Collector {
  constructor(name, filter) {
    super(name, 0);
    this._filter = filter;
  }
  handleProcess(state, prev, val) {
    return this._filter(val) ? prev + 1 : prev;
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `max`
 */
export default class Max extends Collector {
  constructor() {
    super('max', Number.MIN_VALUE);
  }
  handleProcess(state, prev, val) {
    return Math.max(prev, val);
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `mean`
 */
export default class Mean extends Collector {
  constructor() {
    super('mean', 0, ['count', 'sum']);
  }
  handleGet(state) {
    return state.sum / state.count;
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `min`
 */
export default class Min extends Collector {
  constructor() {
    super('min', Number.MAX_VALUE);
  }
  handleProcess(state, prev, val) {
    return Math.min(prev, val);
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `powerSumAvgRunning`
 *   - Modified from the following source:
 *     https://subluminal.wordpress.com/2008/07/31/running-standard-deviations/
 */
export default class PowerSumAvgRunning extends Collector {
  constructor() {
    super('powerSumAvgRunning', 0, ['count']);
  }
  handleProcess(state, prev, val) {
    let newValue = prev;
    newValue += (val * val - prev) / state.count;
    return newValue;
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `standardDeviationRunning`
 *   - Modified from the following source:
 *     https://subluminal.wordpress.com/2008/07/31/running-standard-deviations/
 */
export default class StandardDeviationRunning extends Collector {
  constructor() {
    super('standardDeviationRunning', 0, ['varianceRunning']);
  }
  handleGet(state) {
    return Math.sqrt(state.varianceRunning);
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `standardDeviationStable`
 */
export default class StandardDeviationStable extends Collector {
  constructor() {
    super('standardDeviationStable', 0, ['varianceStable']);
  }
  handleGet(state) {
    return Math.sqrt(state.varianceStable);
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `sum`
 */
export default class Sum extends Collector {
  constructor() {
    super('sum', 0);
  }
  handleProcess(state, prev, val) {
    return prev + val;
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `sumOfSquaredDeviationsStable`
 */
export default class SumOfSquaredDeviationsStable extends Collector {
  constructor() {
    super('sumOfSquaredDeviationsStable', 0, ['values', 'mean']);
  }
  handleGet(state) {
    const len = state.values.length;
    let sum = 0;
    let current = 0;
    for (let i = 0; i < len; i++) {
      current = state.values[i];
      sum += Math.pow(current - state.mean, 2);
    }
    return sum;
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `values`
 */
export default class Values extends Collector {
  constructor() {
    super('values', []);
  }
  handleProcess(state, prev, val) {
    const result = prev.slice(0);
    result.push(val);
    return result;
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `varianceRunning`
 *   - Modified from the following source:
 *     https://subluminal.wordpress.com/2008/07/31/running-standard-deviations/
 */
export default class VarianceRunning extends Collector {
  constructor() {
    super('varianceRunning', 0, ['count', 'mean', 'powerSumAvgRunning']);
  }
  handleGet(state) {
    return (state.powerSumAvgRunning * state.count -
      state.count * state.mean * state.mean) / (
      state.count - 1);
  }
}

import Collector from '../Collector';

/**
 * A collector that captures `varianceStable`
 */
export default class VarianceStable extends Collector {
  constructor() {
    super('varianceStable', 0, ['values', 'sumOfSquaredDeviationsStable']);
  }
  handleGet(state) {
    const len = Math.max(1, state.values.length - 1);
    return state.sumOfSquaredDeviationsStable / len;
  }
}

/**
